CREATE TABLE `nzav1_content` (   `id` int(10) unsigned NOT NULL AUTO_INCREMENT,   `asset_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'FK to the nzav1_assets table.',   `title` varchar(255) NOT NULL DEFAULT '',   `alias` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '',   `title_alias` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT 'Deprecated in Joomla! 3.0',   `introtext` mediumtext NOT NULL,   `fulltext` mediumtext NOT NULL,   `state` tinyint(3) NOT NULL DEFAULT '0',   `sectionid` int(10) unsigned NOT NULL DEFAULT '0',   `mask` int(10) unsigned NOT NULL DEFAULT '0',   `catid` int(10) unsigned NOT NULL DEFAULT '0',   `created` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',   `created_by` int(10) unsigned NOT NULL DEFAULT '0',   `created_by_alias` varchar(255) NOT NULL DEFAULT '',   `modified` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',   `modified_by` int(10) unsigned NOT NULL DEFAULT '0',   `checked_out` int(10) unsigned NOT NULL DEFAULT '0',   `checked_out_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',   `publish_up` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',   `publish_down` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',   `images` text NOT NULL,   `urls` text NOT NULL,   `attribs` varchar(5120) NOT NULL,   `version` int(10) unsigned NOT NULL DEFAULT '1',   `parentid` int(10) unsigned NOT NULL DEFAULT '0',   `ordering` int(11) NOT NULL DEFAULT '0',   `metakey` text NOT NULL,   `metadesc` text NOT NULL,   `access` int(10) unsigned NOT NULL DEFAULT '0',   `hits` int(10) unsigned NOT NULL DEFAULT '0',   `metadata` text NOT NULL,   `featured` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT 'Set if article is featured.',   `language` char(7) NOT NULL COMMENT 'The language code for the article.',   `xreference` varchar(50) NOT NULL COMMENT 'A reference to enable linkages to external data sets.',   PRIMARY KEY (`id`),   KEY `idx_access` (`access`),   KEY `idx_checkout` (`checked_out`),   KEY `idx_state` (`state`),   KEY `idx_catid` (`catid`),   KEY `idx_createdby` (`created_by`),   KEY `idx_featured_catid` (`featured`,`catid`),   KEY `idx_language` (`language`),   KEY `idx_xreference` (`xreference`) ) ENGINE=MyISAM AUTO_INCREMENT=76 DEFAULT CHARSET=utf8;
INSERT INTO `nzav1_content`  VALUES ('71', '175', 'that´s where creativia shines', 'that-s-where-creativia-shines', '', '<p>he lay on his <a href=\"#\">armour-like back</a>, and if he lifted his head a little he could see his brown belly, slightly domed and divided by arches into stiff sections.</p>\r\n<p>the bedding was hardly able to cover it and seemed ready to slide off any moment.</p>\r\n', '\r\n<p><span style=\"line-height: 1.3em;\">his many legs, pitifully thin </span><a href=\"#\" style=\"line-height: 1.3em;\">compared</a><span style=\"line-height: 1.3em;\"> with the size of the rest of him, waved about helplessly as he looked. \"what\'s happened to me? \" he thought. it wasn\'t a dream.</span></p>\r\n<p>his room, a proper human. it showed a lady fitted out with a fur hat and fur boa who sat upright, raising a heavy fur muff that:</p>\r\n<p>- covered the whole of her lower arm towards the viewer<br />- gregor then turned to look out the window at the dull weather.</p>\r\n<p>he must have tried it a <a href=\"#\">hundred times</a>, shut his eyes so that he wouldn\'t have to look at the floundering legs, and only stopped when he began to feel a mild, dull pain there that he had never felt before.</p>', '1', '0', '0', '9', '2013-02-02 16:10:55', '865', '', '2014-01-22 07:59:38', '865', '0', '0000-00-00 00:00:00', '2013-02-02 16:10:55', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/demo-image.jpg\",\"float_intro\":\"right\",\"image_intro_alt\":\"demo\",\"image_intro_caption\":\"\",\"image_fulltext\":\"images\\/demo-image.jpg\",\"float_fulltext\":\"right\",\"image_fulltext_alt\":\"demo\",\"image_fulltext_caption\":\"\"}', '{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', '15', '0', '0', '', '', '1', '424', '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', '0', '*', ''), ('67', '168', 'What\'s New in 1.5?', 'whats-new-in-15', '', '<p>This article deliberately archived as an example.</p><p>As with previous releases, Joomla! provides a unified and easy-to-use framework for delivering content for Web sites of all kinds. To support the changing nature of the Internet and emerging Web technologies, Joomla! required substantial restructuring of its core functionality and we also used this effort to simplify many challenges within the current user interface. Joomla! 1.5 has many new features.</p>\r\n<p style=\"margin-bottom: 0in;\">In Joomla! 1.5, you\'\'ll notice:</p>\r\n<ul>\r\n<li>Substantially improved usability, manageability, and scalability far beyond the original Mambo foundations</li>\r\n<li>Expanded accessibility to support internationalisation, double-byte characters and right-to-left support for Arabic, Farsi, and Hebrew languages among others</li>\r\n<li>Extended integration of external applications through Web services</li>\r\n<li>Enhanced content delivery, template and presentation capabilities to support accessibility standards and content delivery to any destination</li>\r\n<li>A more sustainable and flexible framework for Component and Extension developers</li>\r\n<li>Backward compatibility with previous releases of Components, Templates, Modules, and other Extensions</li>\r\n</ul>', '', '2', '0', '0', '9', '2011-01-01 00:00:01', '865', 'Joomla! 1.5', '2011-01-01 00:00:01', '0', '0', '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '', '', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_readmore\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_hits\":\"\",\"page_title\":\"\",\"alternative_readmore\":\"\",\"layout\":\"\"}', '1', '0', '1', '', '', '1', '0', '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', '0', '*', ''), ('72', '178', 'the latest blog article title', 'the-latest-blog-article-title', '', '<p>he lay on his <a href=\"#\">armour-like back</a>, and if he lifted his head a little he could see his brown belly, slightly domed and divided by arches into stiff sections.</p>\r\n<p>the bedding was hardly able to cover it and seemed ready to slide off any moment.</p>\r\n', '\r\n<p><span style=\"line-height: 1.3em;\">his many legs, pitifully thin </span><a href=\"#\" style=\"line-height: 1.3em;\">compared</a><span style=\"line-height: 1.3em;\"> with the size of the rest of him, waved about helplessly as he looked. \"what\'s happened to me? \" he thought. it wasn\'t a dream.</span></p>\r\n<p>his room, a proper human. it showed a lady fitted out with a fur hat and fur boa who sat upright, raising a heavy fur muff that:</p>\r\n<p>- covered the whole of her lower arm towards the viewer<br />- gregor then turned to look out the window at the dull weather.</p>\r\n<p>he must have tried it a <a href=\"#\">hundred times</a>, shut his eyes so that he wouldn\'t have to look at the floundering legs, and only stopped when he began to feel a mild, dull pain there that he had never felt before.</p>', '1', '0', '0', '78', '2013-02-02 16:10:55', '865', '', '2014-01-13 07:47:50', '865', '0', '0000-00-00 00:00:00', '2013-02-02 16:10:55'