Dionysopoulos\",\"authorEmail\":\"nicholas@dionysopoulos.me\",\"authorUrl\":\"http:\\/\\/www.akeebabackup.com\",\"version\":\"3.6.12\",\"description\":\"Akeeba Backup Core - Full Joomla! site backup solution, Core Edition.\",\"group\":\"\"}', '{\"siteurl\":\"http:\\/\\/dev.vsmarttech.net\\/2247_creativia\\/\",\"jlibrariesdir\":\"\\/home\\/vsmarttech\\/www\\/2247_creativia\\/libraries\",\"jversion\":\"1.6\",\"lastversion\":\"3.6.12\",\"minstability\":\"stable\",\"acceptlicense\":true,\"acceptsupport\":true,\"acceptbackuptest\":true,\"liveupdate\":\"lastcheck=1389262374\\nupdatedata=\\\"\\\"{\\\"supported\\\":true,\\\"stuck\\\":false,\\\"version\\\":\\\"3.9.2\\\",\\\"date\\\":\\\"2013-12-27\\\",\\\"stability\\\":\\\"stable\\\",\\\"downloadURL\\\":\\\"http:\\\\\\/\\\\\\/cdn.akeebabackup.com\\\\\\/downloads\\\\\\/akeebabackup\\\\\\/3.9.2\\\\\\/com_akeeba-3.9.2-core.zip\\\",\\\"infoURL\\\":\\\"https:\\\\\\/\\\\\\/www.akeebabackup.com\\\\\\/downloads\\\\\\/akeeba-backup\\\\\\/3-9-2.html\\\",\\\"releasenotes\\\":\\\"<h3>General information<\\\\\\/h3><p> If you have a problem after or before installing the component please read our <a href=\\\\\\\"https:\\\\\\/\\\\\\/www.akeebabackup.com\\\\\\/home\\\\\\/news\\\\\\/55-general\\\\\\/1502-troubleshooting-instructions-for-feb-2013-releases.html\\\\\\\"> troubleshooting page<\\\\\\/a>. These issues are more likely to occur if you try to upgrade this component while you have an older version of another component of ours still installed on your site.<\\\\\\/p><h3>Release highlights<\\\\\\/h3><p> <b>Improved SFTP support (Professional version)<\\\\\\/b>. We have added support for SFTP connections using public\\\\\\/private key files and    an SFTP directory browser.<\\\\\\/p><p> <b>Hybrid file writing engine for restoring backup archives (Professional version)<\\\\\\/b>.    The integrated restoration now has a third file writing mode, called Hybrid. It    intelligently uses direct file writes or FTP on a file-by-file basis. This allows    easier restoration even on sites on shared hosting experiencing a \\\\\\\"permissions hell\\\\\\\"    situation, i.e. different files are owned by different users making it otherwise    impossible to restore a backup.<\\\\\\/p><p> <b>Interface improvements<\\\\\\/b>.    Small, low priority, but annoying interface issues have been fixed. The most    important one was some browsers automatically filling in your Super User    password in the ANGIE Password field, startling our users when they tried to    restore their backups.<\\\\\\/p><p>    Bug fixes for the System Restore Points feature (Professional version).    We are aware that Akeeba Backup 3.9.0 and 3.9.1 had some issues regarding this    feature. We have identified and resolved all of them. If you are using a code    cache on your site please remember to reset your code cache after installing    this update.<\\\\\\/p><p>    Bug fixes for Dropbox (Professional version). Some users reported issues when    they tried uploading files to Dropbox. This has to do with broken hosts and our    default option of using chunked uploads to overcome Dropbox\' limitations since    Akeeba Backup 3.9.0. We are now using a more intelligent default to overcome    this issue.<\\\\\\/p><h3>PHP 5.3 or 5.4 is required<\\\\\\/h3><p> This version requires PHP 5.3 or 5.4. The rationale behind this is explained in our <a href=\\\\\\\"https:\\\\\\/\\\\\\/www.akeebabackup.com\\\\\\/home\\\\\\/news\\\\\\/55-general\\\\\\/1501-end-of-php52-support.html\\\\\\\"> statement of mid-February 2013<\\\\\\/a>. It won\'t install on hosts running PHP 5.2 or earlier. Moreover, due to the necessary Joomla! API changes found only in Joomla! 2.5.6 or later, this version will not install on Joomla! 2.5.5 or earlier versions. In any case, it will tell you exactly why it cannot be installed (minimum PHP or Joomla! version not satisfied).<\\\\\\/p><h3>Joomla! 2.5 and 3.2 are supported<\\\\\\/h3><p> This version of Akeeba Backup can be installed on Joomla! 2.5.6 or any later 2.5.x release, as well as any 3.2.x release. It is not compatible with Joomla! 3.0 or 3.1. These versions of Joomla! are old and vulnerable.    If you are using them please upgrade to 3.2.<\\\\\\/p><h3>Changelog<\\\\\\/h3><h4>Bug fixes<\\\\\\/h4><ul> <li>[LOW] Dropbox chunked upload would kick in for files less than 150Mb, causing problems in some low quality, yet popular, hosts.<\\\\\\/li> <li>[LOW] Link to retry uploading of failed remote transfer not shown in Manage Backups page<\\\\\\/li> <li>[LOW] Untranslated strings when using the SRP feature<\\\\\\/li> <li>[MEDIUM] The Extension Manager: Update page displays wrong when the System Restore Points feature is enabled on Joomla! 2.5, using Firefox (other Joomla! versions \\\\\\/ browsers are not affected)<\\\\\\/li> <li>[MEDIUM] The alternate CRON backup script (akeeba-altbackup.php) would go on forever<\\\\\\/li><\\\\\\/ul><h4>New features<\\\\\\/h4><ul> <li>Hybrid file writing engine for the integrated restoration feature<\\\\\\/li> <li>SFTP authentication with key files in the \\\\\\\"Upload to Remote SFTP (SSH) Server\\\\\\\" post-processing engine<\\\\\\/li> <li>SFTP connection testing for the \\\\\\\"Upload to Remote SFTP (SSH) Server\\\\\\\" post-processing engine<\\\\\\/li> <li>SFTP directory browser for the \\\\\\\"Upload to Remote SFTP (SSH) Server\\\\\\\" post-processing engine<\\\\\\/li><\\\\\\/ul><h4>Miscellaneous changes<\\\\\\/h4><ul> <li>Better layout for the Component Parameters in Joomla! 3<\\\\\\/li> <li>Changed the wording of the update email to make it abundantly clear that it\'s not sent by Akeeba Ltd<\\\\\\/li> <li>Forbit the browsers to autocomplete the fields in the Backup Now page. Many browsers auto-filled the ANGIE password (usually with the Super User\'s password), catching users by surprise when restoring their sites.<\\\\\\/li> <li>Improved detection of administrator email addresses<\\\\\\/li> <li>Warn users of the Core release that entering the Download ID doesn\'t magically \\\\\\\"unlock\\\\\\\" the Professional features<\\\\\\/li><\\\\\\/ul>\\\"}\\\"\\\"\\nstuck=0\\n\\n[update]\\nstuck=0\\nlastcheck=1390808972\\nupdatedata=\\\"\\\"{\\\\\\\"supported\\\\\\\":true,\\\\\\\"stuck\\\\\\\":false,\\\\\\\"version\\\\\\\":\\\\\\\"3.9.2\\\\\\\",\\\\\\\"date\\\\\\\":\\\\\\\"2013-12-27\\\\\\\",\\\\\\\"stability\\\\\\\":\\\\\\\"stable\\\\\\\",\\\\\\\"downloadURL\\\\\\\":\\\\\\\"http:\\\\\\\\\\\\\\/\\\\\\\\\\\\\\/cdn.akeebabackup.com\\\\\\\\\\\\\\/downloads\\\\\\\\\\\\\\/akeebabackup\\\\\\\\\\\\\\/3.9.2\\\\\\\\\\\\\\/com_akeeba-3.9.2-core.zip\\\\\\\",\\\\\\\"infoURL\\\\\\\":\\\\\\\"https:\\\\\\\\\\\\\\/\\\\\\\\\\\\\\/www.akeebabackup.com\\\\\\\\\\\\\\/downloads\\\\\\\\\\\\\\/akeeba-backup\\\\\\\\\\\\\\/3-9-2.html\\\\\\\",\\\\\\\"releasenotes\\\\\\\":\\\\\\\"<h3>General information<\\\\\\\\\\\\\\/h3><p> If you have a problem after or before installing the component please read our <a href=\\\\\\\\\\\\\\\"https:\\\\\\\\\\\\\\/\\\\\\\\\\\\\\/www.akeebabackup.com\\\\\\\\\\\\\\/home\\\\\\\\\\\\\\/news\\\\\\\\\\\\\\/55-general\\\\\\\\\\\\\\/1502-troubleshooting-instructions-for-feb-2013-releases.html\\\\\\\\\\\\\\\"> troubleshooting page<\\\\\\\\\\\\\\/a>. These issues are more likely to occur if you try to upgrade this component while you have an older version of another component of ours still installed on your site.<\\\\\\\\\\\\\\/p><h3>Release highlights<\\\\\\\\\\\\\\/h3><p> <b>Improved SFTP support (Professional version)<\\\\\\\\\\\\\\/b>. We have added support for SFTP connections using public\\\\\\\\\\\\\\/private key files and    an SFTP directory browser.<\\\\\\\\\\\\\\/p><p> <b>Hybrid file writing engine for restoring backup archives (Professional version)<\\\\\\\\\\\\\\/b>.    The integrated restoration now has a third file writing mode, called Hybrid. It    intelligently uses direct file writes or FTP on a file-by-file basis. This allows    easier restoration even on sites on shared hosting experiencing a \\\\\\\\\\\\\\\"permissions hell\\\\\\\\\\\\\\\"    situation, i.e. different files are owned by different users making it otherwise    impossible to restore a backup.<\\\\\\\\\\\\\\/p><p> <b>Interface improvements<\\\\\\\\\\\\\\/b>.    Small, low priority, but annoying interface issues have been fixed. The most    important one was some browsers automatically filling in your Super User    password in the ANGIE Password field, startling our users when they tried to    restore their backups.<\\\\\\\\\\\\\\/p><p>    Bug fixes for the System Restore Points feature (Professional version).    We are aware that Akeeba Backup 3.9.0 and 3.9.1 had some issues regarding this    feature. We have identified and resolved all of them. If you are using a code    cache on your site please remember to reset your code cache after installing    this update.<\\\\\\\\\\\\\\/p><p>    Bug fixes for Dropbox (Professional version). Some users reported issues when    they tried uploading files to Dropbox. This has to do with broken hosts and our    default option of using chunked uploads to overcome Dropbox\' limitations since    Akeeba Backup 3.9.0. We are now using a more intelligent default to overcome    this issue.<\\\\\\\\\\\\\\/p><h3>PHP 5.3 or 5.4 is required<\\\\\\\\\\\\\\/h3><p> This version requires PHP 5.3 or 5.4. The rationale behind this is explained in our <a href=\\\\\\\\\\\\\\\"https:\\\\\\\\\\\\\\/\\\\\\\\\\\\\\/www.akeebabackup.com\\\\\\\\\\\\\\/home\\\\\\\\\\\\\\/news\\\\\\\\\\\\\\/55-general\\\\\\\\\\\\\\/1501-end-of-php52-support.html\\\\\\\\\\\\\\\"> statement of mid-February 2013<\\\\\\\\\\\\\\/a>. It won\'t install on hosts running PHP 5.2 or earlier. Moreover, due to the necessary Joomla! API changes found only in Joomla! 2.5.6 or later, this version will not install on Joomla! 2.5.5 or earlier versions. In any case, it will tell you exactly why it cannot be installed (minimum PHP or Joomla! version not satisfied).<\\\\\\\\\\\\\\/p><h3>Joomla! 2.5 and 3.2 are supported<\\\\\\\\\\\\\\/h3><p> This version of Akeeba Backup can be installed on Joomla! 2.5.6 or any later 2.5.x release, as well as any 3.2.x release. It is not compatible with Joomla! 3.0 or 3.1. These versions of Joomla! are old and vulnerable.    If you are using them please upgrade to 3.2.<\\\\\\\\\\\\\\/p><h3>Changelog<\\\\\\\\\\\\\\/h3><h4>Bug fixes<\\\\\\\\\\\\\\/h4><ul> <li>[LOW] Dropbox chunked upload would kick in for files less than 150Mb, causing problems in some low quality, yet popular, hosts.<\\\\\\\\\\\\\\/li> <li>[LOW] Link to retry uploading of failed remote transfer not shown in Manage Backups page<\\\\\\\\\\\\\\/li> <li>[LOW] Untranslated strings when using the SRP feature<\\\\\\\\\\\\\\/li> <li>[MEDIUM] The Extension Manager: Update page displays wrong when the System Restore Points feature is enabled on Joomla! 2.5, using Firefox (other Joomla! versions \\\\\\\\\\\\\\/ browsers are not affected)<\\\\\\\\\\\\\\/li> <li>[MEDIUM] The alternate CRON backup script (akeeba-altbackup.php) would go on forever<\\\\\\\\\\\\\\/li><\\\\\\\\\\\\\\/ul><h4>New features<\\\\\\\\\\\\\\/h4><ul> <li>Hybrid file writing engine for the integrated restoration feature<\\\\\\\\\\\\\\/li> <li>SFTP authentication with key files in the \\\\\\\\\\\\\\\"Upload to Remote SFTP (SSH) Server\\\\\\\\\\\\\\\" post-processing engine<\\\\\\\\\\\\\\/li> <li>SFTP connection testing for the \\\\\\\\\\\\\\\"Upload to Remote SFTP (SSH) Server\\\\\\\\\\\\\\\" post-processing engine<\\\\\\\\\\\\\\/li> <li>SFTP directory browser for the \\\\\\\\\\\\\\\"Upload to Remote SFTP (SSH) Server\\\\\\\\\\\\\\\" post-processing engine<\\\\\\\\\\\\\\/li><\\\\\\\\\\\\\\/ul><h4>Miscellaneous changes<\\\\\\\\\\\\\\/h4><ul> <li>Better layout for the Component Parameters in Joomla! 3<\\\\\\\\\\\\\\/li> <li>Changed the wording of the update email to make it abundantly clear that it\'s not sent by Akeeba Ltd<\\\\\\\\\\\\\\/li> <li>Forbit the browsers to autocomplete the fields in the Backup Now page. Many browsers auto-filled the ANGIE password (usually with the Super User\'s password), catching users by surprise when restoring their sites.<\\\\\\\\\\\\\\/li> <li>Improved detection of administrator email addresses<\\\\\\\\\\\\\\/li> <li>Warn users of the Core release that entering the Download ID doesn\'t magically \\\\\\\\\\\\\\\"unlock\\\\\\\\\\\\\\\" the Professional features<\\\\\\\\\\\\\\/li><\\\\\\\\\\\\\\/ul>\\\\\\\"}\\\"\\\"\"}', '', '', '0', '0000-00-00 00:00:00', '0', '0'), ('10032', 'PLG_JMONITORING_AKEEBABACKUP_TITLE', 'plugin', 'akeebabackup', 'jmonitoring', '0', '1', '1', '0', '{\"legacy\":false,\"name\":\"PLG_JMONITORING_AKEEBABACKUP_TITLE\",\"type\":\"plugin\",\"creationDate\":\"May 2012\",\"author\":\"Nicholas K. Dionysopoulos \\/ AkeebaBackup.com\",\"copyright\":\"\",\"authorEmail\":\"nicholas@dionysopoulos.me\",\"authorUrl\":\"http:\\/\\/www.akeebabackup.com\",\"version\":\"1.0\",\"description\":\"PLG_JMONITORING_AKEEBABACKUP_DESCRIPTION\",\"group\":\"\"}', '{\"maxbackupperiod\":\"24\"}', '', '', '0', '0000-00-00 00:00:00', '0', '0'), ('10033', 'lib_fof', 'library', 'lib_fof', '', '0', '1', '1', '0', '{\"legacy\":false,\"name\":\"lib_fof\",\"type\":\"library\",\"creationDate\":\"2012-12-24\",\"author\":\"Nicholas K. Dionysopoulos \\/ AkeebaBackup.com\",\"copyright\":\"(C)2011-2013 Nicholas K. Dionysopoulos\",\"authorEmail\":\"nicholas@akeebabackup.com\",\"authorUrl\":\"https:\\/\\/www.akeebabackup.com\",\"version\":\"1.3.1\",\"description\":\"Framework-on-Framework (FOF) \\u2013 A rapid component development framework extension for Joomla!\",\"group\":\"\"}', '{}', '', '', '0', '0000-00-00 00:00:00', '0', '0'), ('10034', 'AkeebaStrapper', 'file', 'files_strapper', '', '0', '1', '0', '0', '{\"legacy\":false,\"name\":\"AkeebaStrapper\",\"type\":\"file\",\"creationDate\":\"July 2012\",\"author\":\"Nicholas K. Dionysopoulos\",\"copyright\":\"(C) 2012 Akeeba Ltd.\",\"authorEmail\":\"nicholas@dionysopoulos.me\",\"authorUrl\":\"https:\\/\\/www.akeebabackup.com\",\"version\