 href=\"#\">armour-like back</a>, and if he lifted his head a little he could see his brown belly, slightly domed and divided by arches into stiff sections.</p>\r\n<p>the bedding was hardly able to cover it and seemed ready to slide off any moment.</p>\r\n\";s:4:\"body\";s:702:\"\r\n<p> </p>\r\n<p>his many legs, pitifully thin <a href=\"#\">compared</a> with the size of the rest of him, waved about helplessly as he looked. \"what\'s happened to me? \" he thought. it wasn\'t a dream.</p>\r\n<p>his room, a proper human. it showed a lady fitted out with a fur hat and fur boa who sat upright, raising a heavy fur muff that:</p>\r\n<p>- covered the whole of her lower arm towards the viewer<br />- gregor then turned to look out the window at the dull weather.</p>\r\n<p>he must have tried it a <a href=\"#\">hundred times</a>, shut his eyes so that he wouldn\'t have to look at the floundering legs, and only stopped when he began to feel a mild, dull pain there that he had never felt before.</p>\";s:5:\"catid\";s:1:\"9\";s:10:\"created_by\";s:3:\"865\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"2014-01-17 07:53:10\";s:11:\"modified_by\";s:3:\"865\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":137:{s:10:\"enable_css\";s:1:\"1\";s:14:\"jQueryHandling\";s:9:\"1.8remote\";s:21:\"backendJQueryHandling\";s:6:\"remote\";s:8:\"userName\";s:1:\"1\";s:9:\"userImage\";s:1:\"1\";s:15:\"userDescription\";s:1:\"1\";s:7:\"userURL\";s:1:\"1\";s:9:\"userEmail\";s:1:\"0\";s:12:\"userFeedLink\";s:1:\"1\";s:12:\"userFeedIcon\";s:1:\"1\";s:13:\"userItemCount\";s:2:\"10\";s:13:\"userItemTitle\";s:1:\"1\";s:19:\"userItemTitleLinked\";s:1:\"1\";s:19:\"userItemDateCreated\";s:1:\"1\";s:13:\"userItemImage\";s:1:\"1\";s:17:\"userItemIntroText\";s:1:\"1\";s:16:\"userItemCategory\";s:1:\"1\";s:12:\"userItemTags\";s:1:\"1\";s:22:\"userItemCommentsAnchor\";s:1:\"1\";s:16:\"userItemReadMore\";s:1:\"1\";s:17:\"userItemK2Plugins\";s:1:\"1\";s:18:\"defaultUsersItemid\"