cess\";i:1;}}s:6:\"Author\";a:1:{s:10:\"Super User\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:10:\"Super User\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}s:11:\"K2 Category\";a:1:{s:22:\"K2 Default Blog Layout\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:22:\"K2 Default Blog Layout\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}s:8:\"Language\";a:1:{s:1:\"*\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:1:\"*\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}}s:3:\"url\";s:39:\"index.php?option=com_k2&view=item&id=25\";s:5:\"route\";s:68:\"index.php?option=com_k2&view=item&id=25:k2-article-demo-3&Itemid=491\";s:5:\"title\";s:17:\"k2 article demo 3\";s:11:\"description\";s:237:\"he lay on his armour-like back , and if he lifted his head a little he could see his brown belly, slightly domed and divided by arches into stiff sections. the bedding was hardly able to cover it and seemed ready to slide off any moment.\";s:9:\"published\";N;s:5:\"state\";i:1;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2013-02-18 17:28:44\";s:16:\"publish_end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"start_date\";s:19:\"2013-02-18 17:28:44\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:1;}'), ('36', 'index.php?option=com_k2&view=item&id=23', 'index.php?option=com_k2&view=item&id=23:k2-article-demo-1&Itemid=491', 'k2 article demo 1', 'he lay on his armour-like back , and if he lifted his head a little he could see his brown belly, slightly domed and divided by arches into stiff sections. the bedding was hardly able to cover it and seemed ready to slide off any moment.', '2014-01-17 14:53:17', '95c3fcb65b48327f8af3ad3868d42535', '1', '1', '1', '*', '2013-02-18 17:25:28', '0000-00-00 00:00:00', '2013-02-18 17:25:28', '0000-00-00 00:00:00', '0', '0', '1', 'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:25:{s:2:\"id\";s:2:\"23\";s:5:\"alias\";s:17:\"k2-article-demo-1\";s:7:\"summary\";s:269:\"<p>he lay on his <a href=\"#\">armour-like back</a>, and if he lifted his head a little he could see his brown belly, slightly domed and divided by arches into stiff sections.</p>\r\n<p>the bedding was hardly able to cover it and seemed ready to slide off any moment.</p>\r\n\";s:4:\"body\";s:702:\"\r\n<p> </p>\r\n<p>his many legs, pitifully thin <a href=\"#\">compared</a> with the size of the rest of him, waved about helplessly as he looked. \"what\'s happened to me? \" he thought. it wasn\'t a dream.</p>\r\n<p>his room, a proper human. it showed a lady fitted out with a fur hat and fur boa who sat upright, raising a heavy fur muff that:</p>\r\n<p>- covered the whole of her lower arm towards the viewer<br />- gregor then turned to look out the window at the dull weather.</p>\r\n<p>he must have tried it a <a href=\"#\">hundred times</a>, shut his eyes so that he wouldn\'t have to look at the floundering legs, and only stopped when he began to feel a mild, dull pain there that he had never felt before.</p>\";s:5:\"catid\";s:1:\"9\";s:10:\"created_by\";s:3:\"865\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"2014-01-17 07:53:17\";s:11:\"modified_by\";s:3:\"865\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":137:{s:10:\"enable_css\";s:1:\"1\";s:14:\"jQueryHandling\";s:9:\"1.8remote\";s:21:\"backendJQueryHandling\";s:6:\"remote\";s:8:\"userName\";s:1:\"1\";s:9:\"userImage\";s:1:\"1\";s:15:\"userDescription\";s:1:\"1\";s:7:\"userURL\";s:1:\"1\";s:9:\"userEmail\";s:1:\"0\";s:12:\"userFeedLink\";s:1:\"1\";s:12:\"userFeedIcon\";s:1:\"1\";s:13:\"userItemCount\";s:2:\"10\";s:13:\"userItemTitle\";s:1:\"1\";s:19:\"userItemTitleLinked\";s:1:\"1\";s:19:\"userItemDateCreated\";s:1:\"1\";s:13:\"userItemImage\";s:1:\"1\";s:17:\"userItemIntroText\";s:1:\"1\";s:16:\"userItemCategory\";s:1:\"1\";s:12:\"userItemTags\";s:1:\"1\";s:22:\"userItemCommentsAnchor\";s:1:\"1\";s:16:\"userItemReadMore\";